import Level from "../src/components/Level";
import Level2 from "./components/Level2";

import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" component={Level} />
        <Route path="/level2" component={Level2} />
      </div>
    </Router>
  );
}

export default App;
